import React, { useState } from 'react'
import { NavLink } from "react-router-dom"
import { Registrar } from "./Registrar"
import { Listar } from "./Listar"
import { Estadistica } from "./Estadistica"
import Logo from '../assets/img/geeksmart.jpg';
import {DesktopOutlined,FileOutlined, PieChartOutlined, TeamOutlined,UserOutlined,} from '@ant-design/icons'
import { Breadcrumb, Layout, Menu, theme } from 'antd';
const { Header, Content, Footer, Sider } = Layout;
function getItem(label, key, icon, children) {
  return {
    key,
    icon,
    children,
    label,
  };
}


export const Sailbar = (props) => {

  const [reg, setReg] = useState("");
  const [lis, setLis] = useState("");
  const [est, setEst] = useState("");
  const [collapsed, setCollapsed] = useState(false);
  
  function cerrarSesion(){
    document.getElementById("caja_menu").style.display = "none";
    document.getElementById("form_login").style.display = "block";
    document.getElementById("txtusu").value = "";
    document.getElementById("txtpas").value = "";
    document.getElementById("txtusu").focus();
  }
  function op_registrar(){
    setReg("1");
    setLis("0");
    setEst("0");
  }
  function op_listar(){
    setReg("0");
    setLis("1");
    setEst("0");
  }
  function op_estadistica(){
    setReg("0");
    setLis("0");
    setEst("1");
  }
  

  const items = [
    getItem('Dashboard', '1', <PieChartOutlined />),
    getItem('Servicio', 'Servicio', <UserOutlined />, [
      getItem('Servicio Telefonos', '3'),
      getItem('Servicio PC', '4'),
      getItem('Servicio de Otros Equipo', '5'),
    ]),
    getItem('Clientes', 'sub2', <TeamOutlined />, [getItem('Nuevo Cliente', '6'), getItem('Tabla de clientes', '8')]),
    getItem('Reportes', 'sub3', <TeamOutlined />, [getItem('Informes de Servicio ', '10'),getItem('Informes de ganancias', '12'), getItem('Informes de Cliente', '11')]),
    getItem('Files', '9', <FileOutlined />),
    getItem('Cerrar seccion ', '6', <DesktopOutlined />,),
    getItem
  ];
   
  return (
    
    
    <>
      <Layout  style={{ minHeight: '100vh',}}>
      <div className='bg-indigo-600' >
      <Sider className='bg-indigo-600'   style={{ height:"500px",background:"#4f46e5", }} collapsible collapsed={collapsed} onCollapse={(value) => setCollapsed(value)}>
      <div className="flex flex-shrink-0 p-4 px-4 bg-indigo-600">
                    <a href="#" className="flex-shrink-0 block w-full group">
                        <div className="flex items-center">
                            <div>
                                 <img className="h-10 w-10 rounded-full mx-auto h-23 w-auto space-y-6" src={Logo}></img>
                            </div>
                            <div className="ml-3">
                                <p className="text-sm font-medium text-white">GEEK SMART</p>
                            </div>
                        </div>
                    </a>
                      </div>
                      
        <Menu className='bg-indigo-600'  defaultSelectedKeys={['1']} mode="inline" items={items} />
        
      </Sider>
      </div>
      <Layout>
        <Header style={{ padding: 0,  }} />
        <Content style={{  margin: '0 16px', }}>
          <Breadcrumb style={{ margin: '16px 0', }} >
            <Breadcrumb.Item>User</Breadcrumb.Item>
            <Breadcrumb.Item>Bill</Breadcrumb.Item>
          </Breadcrumb>
          <div style={{padding: 24,minHeight: 360, }}>
           <Registrar/> 
          </div>
        </Content>
        <Footer style={{textAlign: 'center',}}>
          Ant Design Â©{new Date().getFullYear()} Created by Ant UED
        </Footer>
      </Layout>
    </Layout>
</>
   );
};

export default Sailbar;
